import Button from '@material-ui/core/Button';
import axios from 'axios';




const templatelst = [
    {
        "name": [
            "Natural One",
            "Techno 01",
            "Sporty"
        ],
        "versions": [
            "1.0.0",
            "1.0.1",
            "1.1.0",
            "2.0.0",
            "1.1.1",
            "2.0.1",
            "1.2.0",
            "1.2.1",
            "1.3.0"
        ]
    }
]

