//                     }).catch(err=>{
//              console.log(err);
//    })


  this.setState({versionlst:templatelst[0]});

//console.log(templatelst[0])


}

    render()
    {

        return(
            <div>
                 <TextField label="Url" name="Url" id="Url"/>

{console.log("Length - "+this.state.versionlst.length)}

                 <FormControl variant="outlined">    
                    <Select 
                    labelId="demo-simple-select-outlined-label"
                    id="demo-simple-select-outlined"
                    >
       {this.state.versionlst.length>0?this.state.versionlst.versions.map((item) => <option key={item} value={item}>{item}</option>):""}

                    </Select>
                </FormControl>
